import React, { Component } from 'react';
const TITLES = [
    'a software engineer',
    'a music lover',
    'an enthusiastic learner',
    'an adventure seeker'
  ];
  class Title extends Component {
      constructor(props) {
          super(props);
          this.state ={
              titleIndex : 0
          }
      }
      componentDidMount(){
          console.log("title component has mounted")
      }
      render() {
          const title = TITLES[this.state.titleIndex]
          return (
              <div>
                  <p>this is {title}</p>
   
              </div>
              
          );
      }
  }
  
  export default Title;
